import React, { Suspense, lazy } from 'react';
import DashboardLayout from './components/DashboardLayout';

const ChatInterface = lazy(() => import('./components/ChatInterface'));
// Additional components (e.g., Wiki, Reports) can be lazy-loaded similarly.

const App: React.FC = () => {
  return (
    <DashboardLayout>
      <Suspense fallback={<div>Loading Chat Interface...</div>}>
        <ChatInterface />
      </Suspense>
      {/* Additional routes/components can be added here */}
    </DashboardLayout>
  );
};

export default App;
